"use strict";

function f_gold(nums, maximumBit) {
    const n = nums.length;
    const s = new Array(n + 1).fill(0);
    for (let i = 0; i < n; i++) {
        s[i + 1] = s[i] ^ nums[i];
    }
    const ans = [];
    for (let i = n; i > 0; i--) {
        let x = s[i];
        let t = 0;
        for (let j = 0; j < maximumBit; j++) {
            if (((x >> j) & 1) === 0) {
                t |= 1 << j;
            }
        }
        ans.push(t);
    }
    return ans;
}
